import React from 'react';

function Tess() {
    const options = {
        xAxis: {
            type : "datetime",
            labels : {
                format : '{value:%Y-%m}'
            }
        },
        chart : {
            height : 600
        },
        accessibility: {
            enabled : false
        },
        series: [
            {
                name : 'Kline',
                data : [1, 2, 3],
            }
        ],
        stockTools : {
            gui : {
                buttons: ["indicators", "fullScreen"]
            }
        }
    }

    return (
        <>
            <HighchartStockComp options = {options} />
        </>
    );
}

export default Tess;
